class Dashboard extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isLoading: false,
      notification: [],
    };
    this.handleLoading = this.handleLoading.bind(this);
  }

  handleLoading(action) {
    this.setState({
      isLoading: action,
    });
  }

